    "48800": {
        "Desc": "Encuentra a Charles y pregúntale los detalles del encargo",
        "Talk": [
            [
                {
                    "N": "_1005",
                    "T": "¿Lisa? ¿Estás aquí por lo de la declaración de impuestos?"
                },
                {
                    "N": "Lisa",
                    "T": "Oh, hola cariño. Después de enterarme de lo de la pobre Jean, pensé que podría echarle una mano con algunos de sus deberes más literarios."
                },
                {
                    "N": "_1005",
                    "T": "¡Genial! Entonces, si ya no nos necesitan aquí, nos retiramos."
                },
                {
                    "N": "Lisa",
                    "T": "Un momento... En realidad, Charles se preguntaba si..."
                },
                {
                    "N": "Charles",
                    "T": "Permítame, señorita."
                },
                {
                    "N": "Charles",
                    "T": "Acabo de aceptar un pedido bastante importante, pero, desafortunadamente, nos hemos quedado sin vino y la entrega del Viñedo está atrasada."
                },
                {
                    "N": "Charles",
                    "T": "Si no es mucho pedir, ¿podrían <color=#00E1FFFF>ir a ver qué ocurre con las mercancías</color>?"
                },
                {
                    "N": "_1005",
                    "T": "¿Qué tiene de urgente este pedido?"
                },
                {
                    "N": "Charles",
                    "T": "*Suspira*, llegó en el último minuto. Literalmente, hace solo unos segundos."
                },
                {
                    "N": "Lisa",
                    "T": "Sí, Charles tiene toda la razón."
                },
                {
                    "N": "_0",
                    "T": "Bien, veré qué puedo hacer."
                },
                {
                    "N": "_0",
                    "T": "Está bien, ¡pero será mejor que la casa invite mi próxima bebida!"
                },
                {
                    "N": "Charles",
                    "T": "Jeje... Estoy seguro de que la próxima vez que mi jefe, el Sr. Diluc, esté aquí, él pagará la cuenta por ti."
                },
                {
                    "N": "_1005",
                    "T": "¡Suena bien!"
                }
            ]
        ]
    },
    "48801": {
        "Desc": "Habla con Ernest",
        "Talk": [
            [
                {
                    "N": "_1005",
                    "T": "Así que aquí es donde está la entrega de Charles..."
                },
                {
                    "N": "Ernest",
                    "T": "¿Has venido a rescatarme? He estado una eternidad esperando aquí."
                },
                {
                    "N": "Ernest",
                    "T": "En todo el tiempo que he trabajado en el viñedo, esta es la primera vez que los Hilichurls me asaltan... *Suspira*..."
                },
                {
                    "N": "Ernest",
                    "T": "Si hubieran llegado más tarde, no sé qué habría hecho."
                },
                {
                    "N": "_1005",
                    "T": "#¡No temas! ¡{NICKNAME} es {F#una extraordinaria exterminadora}{M#un extraordinario exterminador} de Hilichurls!"
                },
                {
                    "N": "Ernest",
                    "T": "Se lo agradezco. Entonces, tomen este <color=#00E1FFFF>globo aerostático</color>."
                },
                {
                    "N": "Ernest",
                    "T": "Y tengan cuidado. El objetivo no es atacar a los Hilichurls, es mejor que te asegures que <color=#00E1FFFF>los productos estén intactos</color>, porque no tengo los Moras suficientes para reemplazarlos."
                },
                {
                    "N": "Ernest",
                    "T": "Te espero ahí adelante."
                }
            ]
        ]
    },
