    "48701": {
        "Desc": "Habla con Margaret",
        "Talk": [
            [
                {
                    "N": "Venti",
                    "T": "... Así que el gato que desapareció es tuyo."
                },
                {
                    "N": "_1005",
                    "T": "¡Venti! ¿Viniste a ayudar?"
                },
                {
                    "N": "Venti",
                    "T": "¿Yo? ¿Ayudarte? ¡Por el contrario, soy yo quien necesita ayuda!"
                },
                {
                    "N": "_1005",
                    "T": "Pero acabo de verte hablando con Margaret sobre Príncipe..."
                },
                {
                    "N": "Venti",
                    "T": "¡Ajá! ¡Entonces, Príncipe es el nombre del demonio felino que robó mis <color=#00E1FFFF>cuerdas de hierro astral</color> de repuesto!"
                },
                {
                    "N": "Venti",
                    "T": "Aunque me alegra el corazón ver que el espíritu libre de la ciudad de Mondstadt está vivo en criaturas grandes y pequeñas... ¡Es un poco audaz de su parte!"
                },
                {
                    "N": "Margaret",
                    "T": "¡Jaja, Príncipe es un pequeño bribón travieso!"
                },
                {
                    "N": "_0",
                    "T": "¡Lo dices como una madre mimando a su hijo malcriado!"
                },
                {
                    "N": "_1005",
                    "T": "Te pareces mucho a Barbatos, ¿sabes?"
                },
                {
                    "N": "Venti",
                    "T": "Ajá, una comparación bastante acertada, diría yo... ¡Ejem! ¡Ahora, veamos si conseguimos que su alteza mimada, el Príncipe Bribón de Mondstadt, nos reciba!"
                },
                {
                    "N": "Venti",
                    "T": "Tengo una actuación esta noche y, sin mis cuerdas de repuesto, mi audiencia quedará decepcionada."
                },
                {
                    "N": "_1005",
                    "T": "¿Qué haría un gato con las cuerdas de la lira de Venti?"
                },
                {
                    "N": "Margaret",
                    "T": "¡Todos saben que los gatos se vuelven locos al ver un hilo de lo que sea!"
                },
                {
                    "N": "_1005",
                    "T": "¡¿Qué?!"
                },
                {
                    "N": "Venti",
                    "T": "Las cuerdas de la lira están hechas de hierro astral que contiene energía Anemo. Eso las hace extremadamente duraderas, así que normalmente las enrollo en una bola para cargarlas más fácilmente."
                },
                {
                    "N": "Venti",
                    "T": "¡Es un pequeño truco que aprendes en el oficio de bardo!"
                },
                {
                    "N": "_1005",
                    "T": "¿Las cuerdas contienen energía Anemo?"
                },
                {
                    "N": "_1005",
                    "T": "#¡Eso nos ayudará! ¡{NICKNAME}, es hora de que uses tu <color=#00E1FFFF>Visión Elemental</color> de nuevo!"
                }
            ]
        ]
    },
