        "Talk": [
            [
                {
                    "N": "Margaret",
                    "T": "¡Príncipe! ¿Dónde te metiste? Gracias a los dioses que estás a salvo..."
                },
                {
                    "N": "_1005",
                    "T": "Se aseguró de que lo buscáramos por todas partes."
                },
                {
                    "N": "Margaret",
                    "T": "Oh, Príncipe, ¿cómo pudiste abandonarme así?"
                },
                {
                    "N": "_1005",
                    "T": "Parece que esos dos necesitan algo de tiempo a solas..."
                },
                {
                    "N": "_1005",
                    "T": "Y aquí están tus cuerdas de hierro astral, Venti."
                },
                {
                    "N": "Venti",
                    "T": "¡Las encontraste! ¡Maravilloso! No creí que las volvería a ver."
                },
                {
                    "N": "Venti",
                    "T": "¡Me atrevo a decir que una actuación privada interpretada con estas mismas cuerdas no bastaría para mostrar mi gratitud! ¡Jeje!"
                },
                {
                    "N": "_1005",
                    "T": "¿Una qué?"
                },
                {
                    "N": "Venti",
                    "T": "*Achís*..."
                },
                {
                    "N": "Venti",
                    "T": "*Cof*, jaja... Disculpa, a esta distancia mi alergia a los gatos parece empeorar..."
                },
                {
                    "N": "_1005",
                    "T": "Oh, ahora entiendo por qué no fuiste a buscar tus cuerdas por ti mismo..."
                },
                {
                    "N": "Venti",
                    "T": "Jeje, de todos modos, gracias por la ayuda, me iré ahora... ¡Achú!"
                }
            ]
        ]
